export class TosUniformPack extends BaseNeckProvider implements IUniformPack {

    getUniformSwatches() {
        return [
            new Swatch(BodyType.AverageMale, "Average Male", (token) => UniformCatalog.decorateSwatch(TosUniforms.averageMaleNeck + TosUniforms.averageMaleBody, BodyType.AverageMale, token), "BodyType.averageMale"),
            new Swatch(BodyType.AverageFemale, "Average Female", (token) => UniformCatalog.decorateSwatch(TosUniforms.averageFemaleNeck + TosUniforms.averageFemaleBody, BodyType.AverageFemale, token), "BodyType.averageFemale"),
        ];
    }

    getUniformAndVariantBody(token: Token) {
        let division = DivisionColors.getDivision(token.uniformEra, token.divisionColor);
        let result = "";
        switch (token.bodyType) {
            case BodyType.AverageMale: {
                if (token.variant === UniformVariantType.Base) {
                    result = TosUniforms.averageMaleBody;
                    if (division === Division[Division.Command]) {
                        result += OriginalSeriesMaleBodyCommandSymbol;
                    } else if (division === Division[Division.Science]) {
                        result += OriginalSeriesMaleBodyScienceSymbol;
                    } else if (division === Division[Division.Operations]) {
                        result += OriginalSeriesMaleBodyEngineeringSymbol;
                    }
                } else if (token.variant === UniformVariantType.Variant1 && token.rankIndicator === Rank.Captain
                        && DivisionColors.getDivision(token.uniformEra, token.divisionColor) === Division[Division.Command]) {
                    result = TosUniforms.averageMaleBodyCommandVariant;
                } else if (token.variant === UniformVariantType.Variant2) {
                    result = TosUniforms.averageMaleBodyJumpsuit;
                }
                break;
            }
            case BodyType.AverageFemale:
                if (token.variant === UniformVariantType.Base) {
                    result = TosUniforms.averageFemaleBody;
                    if (division === Division[Division.Command]) {
                        result += OriginalSeriesFemaleBodyCommandSymbol;
                    } else if (division === Division[Division.Science]) {
                        result += OriginalSeriesFemaleBodyScienceSymbol;
                    } else if (division === Division[Division.Operations]) {
                        result += OriginalSeriesFemaleBodyEngineeringSymbol;
                    }
                } else if (token.variant === UniformVariantType.Variant1 && token.rankIndicator === Rank.Captain
                        && DivisionColors.getDivision(token.uniformEra, token.divisionColor) === Division[Division.Command]) {
                    result = TosUniforms.averageFemaleBodyCommandVariant;
                }
                break;
            default:
        }

        return this.getNeck(token.bodyType, token.skinColor, token.species) + result.replace(DefaultRed, token.divisionColor).replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor);
    }

    getUniformVariantSwatches(token: Token) {
        let swatches = [];
        if (token.bodyType === BodyType.AverageMale) {
            swatches.push(new Swatch(UniformVariantType.Base, "Standard Uniform", (token) => UniformCatalog.decorateSwatch(TosUniforms.averageMaleNeck + TosUniforms.averageMaleBody, 1000 + UniformVariantType.Base, token)));
            if (DivisionColors.getDivision(token.uniformEra, token.divisionColor) === "Command" && token.rankIndicator === Rank.Captain) {
                swatches.push(new Swatch(UniformVariantType.Variant1, "Command Variant", (token) => UniformCatalog.decorateSwatch(TosUniforms.averageMaleNeck + TosUniforms.averageMaleBodyCommandVariant, 1000 + UniformVariantType.Variant1, token)));
            }
            swatches.push(new Swatch(UniformVariantType.Variant2, "Jumpsuit", (token) => UniformCatalog.decorateSwatch(TosUniforms.averageMaleNeck + TosUniforms.averageMaleBodyJumpsuit, 1000 + UniformVariantType.Variant2, token)));

            return swatches;
        } else {
            swatches.push(new Swatch(UniformVariantType.Base, "Standard Uniform", (token) => UniformCatalog.decorateSwatch(TosUniforms.averageMaleNeck + TosUniforms.averageMaleBody, 1000 + UniformVariantType.Base, token)));
            if (DivisionColors.getDivision(token.uniformEra, token.divisionColor) === "Command" && token.rankIndicator === Rank.Captain) {
                swatches.push(new Swatch(UniformVariantType.Variant1, "Command Variant", (token) => UniformCatalog.decorateSwatch(TosUniforms.averageMaleNeck + TosUniforms.averageMaleBodyCommandVariant, 1000 + UniformVariantType.Variant1, token)));
                return swatches;
            } else {
                return [];
            }
        }
    }

    getRankSwatches() {
        return [
            new Swatch(Rank.None, "None", (token) => TosUniformPack.decorateRankSwatch("", Rank.None, token), "Rank.none.name"),
            new Swatch(Rank.Ensign, "Ensign", (token) => TosUniformPack.decorateRankSwatch(TosEnsign, Rank.Ensign, token), "Rank.ensign.name"),
            new Swatch(Rank.LieutenantJG, "Lieutenant J.G.", (token) => TosUniformPack.decorateRankSwatch(TosLieutenantJG, Rank.LieutenantJG, token), "Rank.lieutenantJG.name"),
            new Swatch(Rank.Lieutenant, "Lieutenant", (token) => TosUniformPack.decorateRankSwatch(TosLieutenant, Rank.Lieutenant, token), "Rank.lieutenant.name"),
            new Swatch(Rank.LtCommander, "Lt. Commander", (token) => TosUniformPack.decorateRankSwatch(TosLtCommander, Rank.LtCommander, token), "Rank.ltCommander.name"),
            new Swatch(Rank.Commander, "Commander", (token) => TosUniformPack.decorateRankSwatch(TosCommander, Rank.Commander, token), "Rank.commander.name"),
            new Swatch(Rank.Captain, "Captain", (token) => TosUniformPack.decorateRankSwatch(TosCaptain, Rank.Captain, token), "Rank.captain.name")
        ];
    }

    getRankIndicator(token: Token) {
        return "";
    }

    getRankBorderIndicator(token: Token) {
        switch (token.rankIndicator) {
            case Rank.Ensign:
                return TosEnsignRankBorder.replace(DefaultRed, token.divisionColor);
            case Rank.LieutenantJG:
                return TosLieutenantJGBorder.replace(DefaultRed, token.divisionColor);
            case Rank.Lieutenant:
                return TosLieutenantBorder.replace(DefaultRed, token.divisionColor);
            case Rank.LtCommander:
                return TosLtCommanderBorder.replace(DefaultRed, token.divisionColor);
            case Rank.Commander:
                return TosCommanderBorder.replace(DefaultRed, token.divisionColor);
            case Rank.Captain:
                if (token.variant === UniformVariantType.Variant1 && DivisionColors.getDivision(UniformEra.OriginalSeries, token.divisionColor) === "Command") {
                    return TosCaptainBorder.replace(DefaultRed, "#88966c");
                } else {
                    return TosCaptainBorder.replace(DefaultRed, token.divisionColor);
                }
            default:
                return "";
        }
    }

    getBorderColor(token: Token) {
        if (token.variant === UniformVariantType.Variant1 && DivisionColors.getDivision(UniformEra.OriginalSeries, token.divisionColor) === "Command"
                && token.rankIndicator === Rank.Captain) {
            return "#88966c";
        } else {
            return token.divisionColor;
        }
    }


    getRankBorderDefinitions(token: Token, bordered: boolean) {
        return "";
    }

    static decorateRankSwatch(svg: string, rankIndicator: Rank, token: Token) {
        return `<svg viewBox="0 0 80 80" version="1.1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
            <defs>
                <clipPath id="rankClipPath` + rankIndicator + `">
                    <circle cx="40" cy="40" r="40" fill="#ffffff" />
                </clipPath>
            </defs>
            <g clip-path="url(#rankClipPath` + rankIndicator + `">
                <g transform="translate(-65, -318)">`
        + svg.replace(DefaultRed, token.divisionColor)
        + `</g>
        + </g>
        </svg>`;
    }

    getBorderLogo(token: Token): string {
        let division = DivisionColors.getDivision(token.uniformEra, token.divisionColor);
        if (division === Division[Division.Command]) {
            return TosCommandDelta;
        } else if (division === Division[Division.Operations]) {
            return TosEngineeringDelta;
        } else {
            return TosScienceDelta;
        }
    }
}

